//navigateur bar 
import React from 'react';
import { NavLink } from "react-router-dom"


const Navbar = () => {
  return (
   <nav>
    <div className="nav-container">
        <div className="logo">
            <NavLink exact to="/">
                <div className="logo">
                    <img src="./img/icon.png" alt="icon"/>

                </div>
            </NavLink>
        </div>
    </div>
   </nav>
  );
};

export default Navbar;
